import React from 'react'
import './Auth.css'
import Logo from '../img/LifeVenture-logo-no-text.png'

const Auth = () => {
  return (
    <div className="Auth">
        <div className="a-left">
              <img src={Logo}/>
        </div>
    </div>
  )
}

export default Auth
